import React from 'react'
import imagenes from "../assets/imagenes";

function Ciclismo() {
    return (
      <div>        
        <h3 className="text-center">Ciclismo</h3> 
        <P>Senderismo es sinónimo de excursionismo a pie, Es decir, caminatas que se realizan principalmente por senderos y caminos. El grado de dificultad no suele ser alto.  Es una mezcla de actividad deportiva y turística, que se desarrolla principalmente en entornos naturales.

           El senderismo es un deporte en la naturaleza que por su sencillez, ausencia de riesgo y bajo coste económico es una actividad muy adecuada para amplios segmentos de la población. 

          Tradicionalmente esta actividad era realizada por los Centros Excursionistas, pero hoy en día, gracias a los senderos señalizados, es posible realizar todo tipo de caminatas de cualquier nivel, y en cualquier destino, tanto por cuenta propia como organizado por empresas de guías o interpretativos del medio natural.</P> 
        <img class="center" src={imagenes.img4}/>
      </div>
    );
  }

  export default Ciclismo;
